/**
 * @param {string} s
 * @return {string[]}
 */
let findRepeatedDnaSequences = (s) => {
    const selectedSequences = new Set();
    const allSequences = new Set();
    let sequence;

    for (let i = 0; i <= s.length - 10; i++) {
        sequence = s.substring(i, i + 10);
        if (!allSequences.has(sequence) && !selectedSequences.has(sequence)) {
            allSequences.add(sequence);
        } else if (!selectedSequences.has(sequence)) {
            allSequences.delete(sequence);
            selectedSequences.add(sequence);
        }
    }

    return Array.from(selectedSequences)
};

